componentsModule.modules.created_at={start:function(){let current=componentsModule.modules.created_at;current.parentElement=document.querySelector("[data-component=created_at]");current.customCheck=current.parentElement.querySelector("[name=component_created]");current.dateBox=current.parentElement.querySelector(".component_created_custom");current.dateInput=current.dateBox.querySelector("input");current.clearInput=current.dateBox.querySelector(".clear-input");current.customCheck.checked=false;componentsModule.initializeEvents([{event:"change",element:current.customCheck,content:function(){if(!!(current.customCheck.checked)){current.dateBox.classList.remove("hide")}else{current.dateBox.classList.add("hide")}reloadPackery()}},{event:"click",element:current.clearInput,content:function(){current.dateInput.value=""}}])},resume:function(){let current=componentsModule.modules.created_at;const a=current.parentElement.getAttribute("data-resume");if(a===""){return true}current.dateInput.value=JSON.parse(a).created_at},validate:function(){return true},serialize:function(){let current=componentsModule.modules.created_at;const a=!!(current.customCheck.checked);let data=false;if(a&&current.dateInput.value!==""){data=current.dateInput.value.trim()}return{created_at:data}}};